import React, { useState, useEffect } from "react";
import axios from "axios";
import "./index.css";

function CodeNames() {
  const [gameWords, setGameWords] = useState([]);

  useEffect(() => {
    fetchGameWords();
  }, []);

  const fetchGameWords = async () => {
    try {
      const response = await axios.get("/start_codenames_game");
      setGameWords(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="codenames">
      <button onClick={fetchGameWords}>Start Game</button>
      <div className="grid">
        {gameWords.map((word, index) => (
          <div key={index} className={`box ${gameWords[word]}`}>
            {word}
          </div>
        ))}
      </div>
    </div>
  );
}

export default CodeNames;
